import React from 'react';
import './Content.css';

const Part = (props) => {
  const { name, exercises } = props.part;
  return (
    <p>
      {name}: <em>{exercises}</em>
    </p>
  );
};

const Content = (props) => (
  <>
    <Part part={props.parts[0]} />
    <Part part={props.parts[1]} />
    <Part part={props.part[2]} />
  </>
);

export default Content;
